import React, { useState } from "react";

function App() {
  const [log, setLog] = useState([]);
  const [input, setInput] = useState("");
  const [reply, setReply] = useState("");

  // Placeholder for sending message to backend
  const sendMessage = async () => {
    setLog((prev) => [...prev, { from: "You", text: input }]);
    // TODO: Call backend API here
    setInput("");
  };

  // Placeholder for receiving reply from backend
  const receiveReply = (msg) => {
    setLog((prev) => [...prev, { from: "Agent", text: msg }]);
  };

  return (
    <div style={{ maxWidth: 600, margin: "40px auto", fontFamily: "sans-serif" }}>
      <h2>Jenkins Remoting Web Demo</h2>
      <div style={{ border: "1px solid #ccc", padding: 16, minHeight: 200, background: "#fafafa" }}>
        {log.map((entry, i) => (
          <div key={i} style={{ margin: "8px 0" }}>
            <b>{entry.from}:</b> {entry.text}
          </div>
        ))}
      </div>
      <div style={{ marginTop: 16 }}>
        <input
          value={input}
          onChange={(e) => setInput(e.target.value)}
          onKeyDown={(e) => e.key === "Enter" && sendMessage()}
          placeholder="Type a message to agent..."
          style={{ width: "70%", padding: 8 }}
        />
        <button onClick={sendMessage} style={{ padding: 8, marginLeft: 8 }}>
          Send
        </button>
      </div>
    </div>
  );
}

export default App;
